def getRunTime(func):
    @functools.wraps(func)
    def wrapper(*args, **kw):
        print('call %s():' % func.__name__)
        begin = datetime.datetime.now()
        rtn = func(*args, **kw)
        end = datetime.datetime.now()
        dur = end - begin
        print("Runtime:", dur)
        return rtn
    return wrapper


