def maxWater(height):
    """
    :type height: List[int]
    :rtype: int
    """
    lstLen = len(height)
    MaxArea = 0
    MaxIdx1, MaxIdx2 = -1, -1
    for i, vali in enumerate(height):
        for j, valj in enumerate(height[i+1:]):
            print("i:%d j:%d"%(i, j+i+1))
            width = (j + i + 1) - i;
            hei = min(valj, vali)
            area = width * hei
            if area > MaxArea:
                MaxIdx1 , MaxIdx2 = i, j+i+1
                MaxArea = area
    print("Max:%d ===i:%d vali:%d   j:%d valj:%d"%(MaxArea, MaxIdx1, height[MaxIdx1], MaxIdx2, height[MaxIdx2]))
    return MaxArea

def maxWater2(height):
    r, l = len(height)-1, 0
    MaxArea = r * min(height[r], height[l])
    while r > l:
        print("l:%d r:%d"%(l,r))
        fac = height[r] >= height[l]
        l = l + fac
        r = r - (fac == 0)
        print("===>l:%d r:%d"%(l,r))
        MaxArea = max(MaxArea, (r-l) * min(height[r], height[l]))
    return MaxArea

