'''
# there 2 pointer: 2nd points the nth items from 1st ; so when the 2nd reach the
# last node of listnode, 1st is the nth item from the end of list
'''
@getRunTime
def RemoveRevNth_2(node ,n):
    PrePtr, PostPtr = node, node
    # set Pre pointer to Nth item
    for i in range(n):
        PrePtr = PrePtr.next
    tmpPtr = None
    while PrePtr:
        tmpPtr = PostPtr
        PostPtr = PostPtr.next
        PrePtr = PrePtr.next

    if tmpPtr == None:
        node = node.next
    else:
        tmpPtr.next = PostPtr.next
    return node

